    .header-bar {
      position: absolute;
      left: 0;
      right: 0;
      top: 105px;
      height: 80px;
      background: #f68121;
      display: flex;
      align-items: center;
      padding-left: 70px;
      z-index: 2;
    }

    .header-bar h1 {
      color: #ffffff;
      font-size: 52px;
      font-weight: 700;
      text-shadow: 0 4px 8px rgba(0,0,0,0.45);
    }

    .header-logo-circle {
      position: absolute;
      right: 40px;
      top: 22px;
      width: 230px;
      height: 230px;
      z-index: 3;
    }

    .header-logo-circle img {
      width: 100%;
      height: 100%;
      object-fit: contain;
    }

    /* CUERPO NARANJA */
    .body-section {
      width: 100%;              /* mismo ancho que el wrapper */
      height: 360px;            /* alto definido */
      background: #f68121;
      color: #ffffff;
      display: grid;
      grid-template-columns: 1.45fr 0.55fr;
      padding: 40px 55px;       /* padding ajustado para no desbordar */
      align-items: center;
    }

    .body-left {
      text-align: center;
      font-size: 27px;
      line-height: 1.55;
    }

    .body-left b {
      font-weight: 700;
    }

    .body-right {
      height: 100%;
      display: flex;
      flex-direction: column;
      align-items: flex-start;
      justify-content: center;
      gap: 30px;
    }

    .warning-sign img {
      width: 185px;
      height: auto;
      display: block;
    }

    .datetime {
      text-align: left;
      font-size: 20px;
      font-weight: 600;
      line-height: 1.5;
      padding-left: 10px;
    }

    /* FOOTER */
    .footer {
      width: 100%;
      height: 55px;
      display: flex;
      align-items: center;
      justify-content: center;
      background: #ffffff;
    }

    .footer img {
      height: 32px;
      width: auto;
    }
  </style>
</head>
<!-- Cargar html2canvas -->
<script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js"></script>

<!-- Script que descarga la imagen -->
<script>
  document.getElementById('btn-download').addEventListener('click', function () {
    const target = document.querySelector('.wrapper');
    html2canvas(target, { scale: 2 }).then(canvas => {
      const link = document.createElement('a');
      link.download = 'comunicado.png';
      link.href = canvas.toDataURL('image/png');
      link.click();
    });
  });
</script>

<body>

<form id="comunicado-form" style="width:1125px;margin:20px auto;font-family:'Work Sans', Arial, sans-serif;">
  <fieldset style="border:1px solid #ccc;padding:15px;">
    <legend>Datos del comunicado</legend>

    <div style="display:flex; gap:20px; align-items:center;">

      <label style="display:flex; flex-direction:column;">Sistema:
        <input type="text" id="input-sistema" value="" required style="width:200px;">
      </label>

      <label style="display:flex; flex-direction:column;">Ticket:
        <input type="text" id="input-ticket" value="" required style="width:200px;">
      </label>

      <label style="display:flex; flex-direction:column;">Grupo:
        <input type="text" id="input-grupo" value="" required style="width:200px;">
      </label>

      <button type="submit" style="height:40px;">Actualizar</button>
    </div>

<script>
  document.getElementById('comunicado-form').addEventListener('submit', function (e) {
    e.preventDefault();
    const sistema = document.getElementById('input-sistema').value;
    const ticket  = document.getElementById('input-ticket').value;
    const grupo   = document.getElementById('input-grupo').value;

    document.getElementById('sistema-text').textContent = sistema;
    document.getElementById('ticket-text').textContent  = ticket;
    document.getElementById('grupo-text').textContent   = grupo;

    const now = new Date();
    const pad = n => n.toString().padStart(2, '0');
    const fecha = pad(now.getDate()) + '/' + pad(now.getMonth() + 1) + '/' + now.getFullYear();
    const hora  = pad(now.getHours()) + ':' + pad(now.getMinutes());

    document.getElementById('fecha-text').textContent = fecha;
    document.getElementById('hora-text').textContent  = hora;
  });
</script>


<script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js" integrity="sha512-BNa5lFU9fHuZlyDdc0AGJi/7luWGINuD/7++UZ5EKeosFVJeFt3PcTJS3BM4tiTn6zkRgZNpmjDoE7QqCw/dNw==" crossorigin="anonymous" referrerpolicy="no-referrer"></script>
<script>
  document.getElementById('btn-download').addEventListener('click', function () {
    const target = document.querySelector('.wrapper');
    if (!target) return;
    html2canvas(target, { scale: 2 }).then(canvas => {
      const link = document.createElement('a');
      link.download = 'comunicado.png';
      link.href = canvas.toDataURL('image/png');
      link.click();
    });
  });
</script>
